import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Jumbotron, Button } from "react-bootstrap";
import mainImage from "../../img/header/Space_Needle002.jpg";
import './style.css';

class Homepage extends Component {
    constructor(props) {
      super(props);
      this.state = {};
    }

    render() {
        return (
                <Row>
                    <Col xs={6}>
                        <Jumbotron>
                            <h1>VKBE CONSULTING</h1>
                            <p>
                                A Seattle based software consulting company
                            </p>
                            <p>
                            VKBE is a technology consulting firm specialized in delivering cloud
solutions to our partners.
As certified professionals, we ensure that your infrastructure will have the
performance, resilience and security for your applications to run at scale.
By leveraging Amazon Web Services, we are following the best practices
of cloud computing. Our team is committed to understand your needs
enabling us to deliver a reliable solution for your challenges.
Our mission is to create a seamless transition by providing you with the
necessary resources and knowledge throughout your entire cloud journey.
                            </p>
                            <p>
                                <Button variant="primary">Read Less</Button>
                            </p>
                        </Jumbotron>
                    </Col>
                    <Col xs={6}>
                    <img
                        alt="main image"
                        src={mainImage}
                        width="100%"
                        height="100%"
                    />
                    </Col>
                </Row>
        )
    }
}

  export default Homepage;
